{
    cImage *img = new cImage();
    cLoadPNG(img, CFONTCALIBRI22_BYTEARRAY, sizeof(CFONTCALIBRI22_BYTEARRAY));

    cFontPtr font = cFont::create();
    font->m_charset.m_base       = CFONTCALIBRI22_CHARSET_BASE;
    font->m_charset.m_lineHeight = CFONTCALIBRI22_CHARSET_LINEHEIGHT;
    font->m_charset.m_width      = CFONTCALIBRI22_WIDTH;
    font->m_charset.m_height     = CFONTCALIBRI22_HEIGHT;
    font->m_charset.m_pages      = CFONTCALIBRI22_CHARSET_PAGES;
    for (int i=0; i<256; i++)
    {
        font->m_charset.m_chars[i].m_x        = CFONTCALIBRI22_CHARSET[8*i  ];
        font->m_charset.m_chars[i].m_y        = CFONTCALIBRI22_CHARSET[8*i+1];
        font->m_charset.m_chars[i].m_width    = CFONTCALIBRI22_CHARSET[8*i+2];
        font->m_charset.m_chars[i].m_height   = CFONTCALIBRI22_CHARSET[8*i+3];
        font->m_charset.m_chars[i].m_xOffset  = CFONTCALIBRI22_CHARSET[8*i+4];
        font->m_charset.m_chars[i].m_yOffset  = CFONTCALIBRI22_CHARSET[8*i+5];
        font->m_charset.m_chars[i].m_xAdvance = CFONTCALIBRI22_CHARSET[8*i+6];
        font->m_charset.m_chars[i].m_page     = CFONTCALIBRI22_CHARSET[8*i+7];
    }
    font->m_charset.preProcess();

    font->m_texture->setImage(std::shared_ptr<cImage>(img));

    return (font);
}


